import './App.css';
import { BrowserRouter, Routes, Route } from "react-router-dom"
import Sidebar from './components/Sidebar/Sidebar';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path='/' element={<Sidebar />} />
        <Route path='/projects' element={<Sidebar />} />
        <Route path='*' element={<NotFound />} /> {}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
